import React from 'react';
//import ReactDOM from 'react-dom';
import './App.css';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      character: []
    }
  }

  componentDidMount() {
    fetch('https://rickandmortyapi.com/api/character/ ').then((respones) => {
      respones.json().then((result) => {
        console.warn(result)  
        this.setState({
          character:result
        })
      })
    })
  }

  render() {
    return (
        <div>
        {
          this.state.character ?
          this.state.character.map(list, i => 
          <div>
            <p>{i}</p>
            <p>{list.name}</p>
          </div>
          )
          :
          null
        }

      </div>
    )
  }
}



export default App;
